import styled from "styled-components";
import React from "react";
import Avartar1 from "../../dummyResources/Avartar1.png";
import MainPicDummy from "../../dummyResources/MainPicDummy.jpg";

interface Props {}

const Header = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
`;

const HeaderWrapper = styled.div`
  display: flex;
  width: 100%;
  padding: 10px;
  justify-content: space-between;
`;

const ContainerFeedPage = styled.div`
  width: 100%;
`;

const AvartarImg = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
`;

const HeaderTitle = styled.p`
  font-size: 30px;
  font-weight: 800;
`;

const RequestP = styled.p`
  font-size: 16px;
  font-weight: 600;
  color: gray;
  padding-top: 8px;
`;

const Promo = styled.div`
  width: 100%;
  margin-top: 20px;
`;

const PromoPic = styled.img`
  width: 100%;
`;

const PromoText = styled.div`
  color: white;
  position: relative;
  top: -65px;
  left: 15px;
  width: 60%;
`;

const PromoTextHeading = styled.h3`
  padding-bottom: 11px;
  border-bottom: 1px solid white;
  font-size: 20px;
  font-weight: 800;
`;

const PromoTextDescription = styled.p`
  margin-top: 8px;
  font-size: 10px;
  font-weight: 500;
`;

const FeedContainer = styled.div`
  width: 80%;
  padding: 5%;
`;

const FeedImg = styled.img`
  width: 60px;
  height: 60px;
  border-radius: 5px;
`;

export default function FeedPage(props: Props) {
  return (
    <ContainerFeedPage>
      <Header>
        <HeaderWrapper>
          <HeaderTitle>안암에서</HeaderTitle>
          <RequestP>식탁 건의하기</RequestP>
        </HeaderWrapper>
      </Header>
      <Promo>
        <PromoPic src={MainPicDummy} />
        <PromoText>
          <PromoTextHeading>친구들과 놀러가요!</PromoTextHeading>
          <PromoTextDescription>
            취향이 통하는 대학친구들과 즐기는 공간
          </PromoTextDescription>
        </PromoText>
      </Promo>
      <FeedContainer>
        <FeedImg src={MainPicDummy} />
      </FeedContainer>
      <AvartarImg src={Avartar1} />
      <AvartarImg src={Avartar1} />
    </ContainerFeedPage>
  );
}
